import { useParams } from 'react-router-dom';
import axios from 'axios';

const Detail = () => {
    const { id } = useParams();
    const [news, setNews] = useState(null);

    useEffect(() => {
        axios.get(`http://127.0.0.1:8000/api/v1/ads/${id}/`)
            .then(response => {
                const data = response.data;
                setNews(data);
            })
            .catch(error => {
                console.error(error);
            });
    }, [id]);

    if (news === null) {
        return <h2>Loading...</h2>;
    }

